											<span data-click-area="main"><div class="_7aa"><div class="_4-u2 _57mb _1u44 _3fw6 _4-u8"><div class="_4-u3 _588p"><div class="_3-97 _57zd _77r _5ia1" style="background-image: url(https://z-p3-scontent.fupg4-1.fna.fbcdn.net/v/t39.2365-6/31482312_216989868888635_4927757197225492480_n.png?_nc_cat=111&amp;ccb=1-7&amp;_nc_sid=ad8a9d&amp;_nc_ohc=mLVjcaQAdE0AX8vO9VW&amp;_nc_ht=z-p3-scontent.fupg4-1.fna&amp;oh=00_AfDTVESE_ip2y_Eo7NBpVt0mkn3Fg3oYmFQk6hIhfzUxeQ&amp;oe=64249D3B);min-height: 600px;"><h1 class="_57ze">
        Platform Instagram
      </h1><div class="_57zf fsm fwn fcg">
        Fitur untuk membantu bisnis Anda berinteraksi dengan Pengguna Instagram.
      </div><div class="_5ia2"><table class="uiGrid _51mz" cellspacing="0" cellpadding="0"><tbody><tr class="_51mx"><td class="_51m- vMid"><span><h3>Instagram Graph API</h3><p><a href="/docs/instagram-api">Instagram Graph API</a> memungkinkan pengguna aplikasi Anda mengakses data di akun <a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fbusiness.instagram.com%2F&amp;h=AT3t7oxYDTf6HdAihpcimqLSLj3dvXc0G1tEx4Xkl-IQjgisyz9rZ6iiDAN74YlRn6LCQnrDsgjznn7O0ZGfOU5g2QtORAAr3rNF31fYBMQ5sbFaR67ZnPpL6ztp6TDevWxOwGNvnlsJPdDs" rel="nofollow" target="_blank" data-lynx-mode="hover">Instagram Business</a> dan <a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fhelp.instagram.com%2F2358103564437429&amp;h=AT3cZN-WuN2v4FvkCZVubhwsnE_6tdFQ6ud-mH4TZHW9HBwdDMxk5t0zYlxtkqGqAVAmoj_Q4fJJoERATf7se4cOPVDXL1JUXCgzb_XofPfEXvC4rpvA0dR0pD-4BWJLEXfzeby23Cc7zDvu" rel="nofollow" target="_blank" data-lynx-mode="hover">Kreator Instagram</a>. API tersebut dapat digunakan untuk memperoleh dan menerbitkan media, mengelola dan membalas komentar di medianya, mengidentifikasi media tempat API &#064;disebut oleh pengguna Instagram lain, menemukan media yang diberi tagar, dan memperoleh metadata dan metrik mendasar tentang pengguna Instagram Business dan Kreator Instagram lainnya.</p><h3>API Tampilan Dasar Instagram</h3><p><a href="/docs/instagram-basic-display-api">API Tampilan Dasar Instagram</a> memungkinkan pengguna aplikasi Anda untuk mendapatkan informasi profil dasar, foto, dan video di akun Instagram mereka. API dimaksudkan untuk pengguna Instagram non-&lt;<a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fbusiness.instagram.com%2F&amp;h=AT2uf6NZmTP_i7moQlN5qcTeV8rUWSpGvsJIPaVPfi60hIA-ynmeP8Xo4WrpgyMu5DgZSKEyVgCbVxo8RHw7SCGIXI-rIvtHwiuBP9K0tHadKp1ugKcm1L0C7jOWj13llwfcS0iY6yQ67JFU97SUX76aSMcSmg" rel="nofollow" target="_blank" data-lynx-mode="hover">Bisnis</a> dan non-<a href="https://l.facebook.com/l.php?u=https%3A%2F%2Fhelp.instagram.com%2F2358103564437429&amp;h=AT0z2X9c5H4ZlMXc60ETRR9XWHL9EBtTPjDgV4gVBX6fm_SOP1f_mb0e0pJZHt93XB1y0IArSBPbg5eR2HsKRPueJye37JMbXmx2n3AGYxRQ-ZgbixpON9m5qxQ227WCzGuc-_DyHZLvPE-L" rel="nofollow" target="_blank" data-lynx-mode="hover">Kreator</a>. Jika Anda membangun aplikasi yang akan memungkinkan pengguna menerbitkan media, memoderasi komentar, mengidentifikasi media yang &#064;disebut dan diberi tagar, atau mengambil data tentang pengguna Instagram lainnya, gunakan Instagram Graph API.</p><h3>Berkirim Pesan di Instagram</h3><p>Dukungan API Messenger untuk Instagram (juga dikenal sebagai API Messaging Instagram di Kebijakan Developer) mengizinkan akun Profesional Instagram untuk menggunakan aplikasi Anda dalam mengelola pesan Instagram mereka. API dapat digunakan untuk mengirim dan menerima pesan dari pengguna Instagram lainnya. <a href="/docs/messenger-platform/instagram">Dukungan API Messenger</a></p><h3>Membagikan ke Cerita</h3><p>Dengan <a href="/docs/instagram/sharing-to-stories">Membagikan ke Cerita</a>, Anda dapat mengizinkan pengguna aplikasi membagikan konten mereka sebagai Instagram Stories.</p><h3>Membagikan ke Kabar</h3><p>Dengan <a href="/docs/instagram/sharing-to-feed">Membagikan ke Kabar</a>, Anda dapat mengizinkan pengguna aplikasi membagikan konten mereka ke Kabar Instagram.</p><h3>Penyematan</h3><p><a href="/docs/instagram/embedding">Sematkan</a> postingan foto dan video Instagram di situs web lain.</p></span>
											</td>
